import React from 'react';
import BlogSection from '../components/BlogSection';

const Blog = () => {
  return (
    <div className="page-container">
      <div className="container">
        <h1 className="section-title">Real Estate Blog</h1>
        <BlogSection />
      </div>
    </div>
  );
};

export default Blog;
